import React,{useState}  from 'react';


interface ShowPasswordProps {
  password: string
}


const  {massage , setMassage} = useState("")
const handleChangeInput = (event: any) =>{
     const {value, maxLength} = event.tatget;
     const massage = value.slice(0 , maxLength)
     setState({
       from:{ massage }
     })
}
const ShowPassword = ({ 
  password = '',
}: ShowPasswordProps) => {
  return (
    <div className="flex items-center border-b-2 border-yellow-500  py-2  mt-1 ">
      <input
        className="text-center appearance-none bg-transparent border-none w-full text-black 
        text-3xl mr-5 py-1 px-2 leading-tight 
        focus:outline-none"
        type="password"
        readOnly={true}
        value={password}

      />
    </div>
  )
}


export default ShowPassword
